import React, { Component } from 'react';
import './App.css';
import Logo from './images/logo.png';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
	  <img id="logo" src={Logo} alt="EZNote"></img>
          <p>Hear what your music sounds like!</p>
        </header>
	<div id="body">
	  <div id="instr">
	    <p>Click on the staff to add/remove notes.</p>
	    <p>Click and drag to move a note around.</p>
	  </div>
	</div>
      </div>
    );
  }
}

export default App;
